import React, { useContext, useState } from 'react'
import './Navbar.css';
import { DataContext } from '../../DataContext/DataContext';
import { useNavigate } from 'react-router-dom';

const Navbar = () => {
    const { ordering, setOrdering, grouping, setGrouping } = useContext(DataContext);
    const [localGroup, setLocalGroup] = useState(grouping);
    const [localOrder, setLocalOrder] = useState(ordering);

    const [Dropdown, setDropdown] = useState(false);
    const navigate = useNavigate();

    const toggleChange = () => {
        setDropdown(prev => !prev);
    }

    return (
        <div className='navigation'>
            <div className='display'>
                <div>
                    <button onClick={() => toggleChange()}>Display</button>
                    {
                        Dropdown && (
                            <div >
                                <div className='options'>
                                    <select name="" id=""
                                    >
                                        <option value="">Stauts</option>
                                        <option value="user">User</option>
                                        <option value="priority">Priority</option>
                                    </select>
                                </div>
                                <div className='options'>
                                    <select name="" id=""
                                    >
                                        <option value="">Stauts</option>
                                        <option value="user">User</option>
                                        <option value="priority">Priority</option>
                                    </select>
                                </div>
                            </div>
                        )
                    }
                </div>
            </div>
        </div>
    )
}

export default Navbar
